package leetcode.contest.weekly256;

import org.assertj.core.api.Assertions;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.CsvSource;

class Problem5857Test {

    @ParameterizedTest
    @CsvSource({
            "001,2",
            "11,2",
            "101,5",
            "10011,10",
            ",565139561"
    })
    void test(String input, int result) {
        Assertions.assertThat(new Problem5857().numberOfUniqueGoodSubsequences(
                input
        )).isEqualTo(result);
    }

}